 // If no navigation remove both margins\n  &:not(.has-nav) {\n    width: calc(100%);\n    margin-left: 0;\n  }\n\n  // Prevent content overflow on NC <25\n  max-height: 100vh;\n\n  // https://bugs.webkit.org/show_bug.cgi?id=160953\n  overflow: visible;\n\n  > div.app-navigation {\n    // Reduce size of navigation bar\n    --app-navigation-max-width: 250px !important;\n    max-width: var(--app-navigation-max-width); // NC <29\n\n    // Rounded corners only on left\n    border-top-left-radius: var(--body-container-radius);\n    border-bottom-left-radius: var(--body-container-radius);\n\n    .app-navigation-toggle {\n      // Move up to align with back button of top matter\n      top: 2px;\n      transition: opacity 0.1s ease-in-out;\n      background-color: transparent;\n      opacity: 0.2; // It's ugly\n      &:hover {\n        opacity: 1;\n      }\n    }\n  }\n}\n\n// Hide horizontal scrollbar on mobile\n// For the padding removal above\n#app-content-vue {\n  overflow-x: hidden;\n}\n","// Top bar is above everything else on mobile\nbody:has(.memories-top-bar) > header {\n  @media (max-width: 1024px) {\n    z-index: 0 !important;\n  }\n}\nbody:has(.memories_viewer, .search-overlay) > header {\n  z-index: 0 !important;\n}\n\n// Allow hiding app name (PublicShareHeader)\nheader#header .header-appname {\n  transition: opacity 0.2s ease-in-out;\n  &.hidden {\n    opacity: 0 !important;\n  }\n}\n\n// Our menu buttons\n.memories-menu-item {\n  background-color: transparent !important;\n\n  header#header & {\n    color: var(--color-primary-text) !important;\n  }\n\n  opacity: 0.85;\n  &:hover {\n    opacity: 1;\n  }\n}\n","// Fill all available space\n.fill-block {\n  width: 100%;\n  height: 100%;\n  display: block;\n}\n\n// Go to top left corner with absolute positioning\n.top-left {\n  position: absolute;\n  top: 0;\n  left: 0;\n}\n\n// Hide scrollbar\n@mixin hide-scrollbar {\n  scrollbar-width: none;\n  -ms-overflow-style: none;\n  &::-webkit-scrollbar {\n    display: n